import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  display: flex;
  align-items: center;
  flex-direction: column;
  font-family: "Roboto";
  width: 100%;
  padding: 15px;
`;

const Header = styled.h2`
  display: flex;
  font-weight: 900;
  font-size: 1.2em;
  text-align: center;
  margin-bottom: 15px;
`;

const SubHeader = styled.h3`
  color: red;
  font-size: 1.7em;
  text-align: center;
  font-family: "Black Ops One", cursive;
  letter-spacing: 1px;
`;

const GameTypes = () => {
  return (
    <Wrapper>
      <Header>Welcome in our</Header>
      <SubHeader>Online Gaming</SubHeader>
      <Header>Shop</Header>
    </Wrapper>
  );
};

export default GameTypes;
